style.css:
@-moz-document domain("google.com") {
/* Hide the default logo */
  img#hplogo, img#logocont, img.lnXdpd {
    display: none !important;
  }

  /* Insert custom logo */
  div#hplogo::after, div.lnXdpd::after {
    content: url('https://i.imgur.com/o7LYQM0.png');
    display: block;
    height: auto;
    width: auto;
  }
}
